import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

type Data = {
user_name: string;
time: string
}
export const App = () => {
const urlAPI = "https://localhost:8000/p";
const [datas, setDatas] = useState([]);
console.log(axios.defaults.baseURL)
useEffect( () => {
  axios.get(urlAPI).then((res)=> {
    setDatas(res.data);
  })
},[])
console.log(datas)

return (
  <div className="App">
    <h1>Axios Test</h1>
    <div>
      {datas.map((data: Data) => (
        <div>{data.user_name} : {data.time}</div>
      ))}
    </div>
  </div>
);}
export default App;
